  Use the react-responsive-carousel package to create the Carousel: 
  https://www.npmjs.com/package/react-responsive-carousel


  */




const Carsl = () => {
	return (
		<div style={styles}>
			 <Carousel>
                <div>
                    <img src="assets/1.jpeg" />
